class Appstore extends Component {
  state = { selectedtabid: tabarray[0].tabid, inputval: "" };

  seltab = (tabid) => {
    this.setState({ selectedtabid: tabid });
  };
  inputsval = (event) => {
    this.setState({ inputval: event.target.value });
  };

  tabfilter = () => {
    const { selectedtabid, inputval } = this.state;

    // Filter by selected tab
    const tabfiltered = appData.filter((obj) => obj.type === selectedtabid);

    // Further filter by input value
    const inpfiltered = tabfiltered.filter((obj) =>
      obj.appName.toLowerCase().includes(inputval.toLowerCase())
    );

    return inpfiltered;
  };

  render() {
    let inpfilter = this.tabfilter();
    let { selectedtabid } = this.state;

    return (
      <div className="appstorepage">
        <h1>App Store</h1>
        <div className="inputcontainer">
          <input type="text" placeholder="Search" onChange={this.inputsval} />
          <img
            src="https://assets.ccbp.in/frontend/react-js/app-store/app-store-search-img.png "
            alt="searchicon"
          />
        </div>
        <div className="apptabcontainer">
          {tabarray.map((obj) => (
            <Apptab
              object={obj}
              profun={this.seltab}
              isactive={obj.tabid === selectedtabid}
            />
          ))}
        </div>
        <div className="appresultcontainer">
          {inpfilter.map((obj) => (
            <Appresult object={obj} />
          ))}
        </div>
      </div>
    );
  }
}
export default Appstore;
